    const[fb_list, setfb_List] = useState([]);
  
    useEffect(()=>{
      Axios.get("http://localhost:4001/api/get").then((response)=>{
        setfb_List(response.data)
      })
    }, [])
  
    var handleSubmit = () =>{
      Axios.post('http://localhost:4001/api/insert', {rollNo: rollNo, studentName:studentName, year:year, duration:duration}).then(()=>{
